('2401','2','8352','Wohnung Jesus',Null,'Wohnung am Paseo Maritimo mit Hafenblick, Palma de Mallorca zu verkaufen','33741','Diese Wohnung befindet sich direkt am Paseo Maritimo mit Blick auf den Jachthafen und die Kathedrale von Palma de Mallorca. Die Wohnung liegt im 6. OG eines überwachten und sicheren Apartmenthauses und kann über einen Gästelift oder einem Bediensteten Lift zu erreichen werden. Die ca 180m² Wohnfläche (plus 20m² Terrasse) verteilen sich auf Eingangsdiele, Wohn-Esszimmer, 3 Schlafzimmer mit je einem Badezimmer en suite, Einbauküche mit Hauswirtschaftsraum und einem Abstellraum. Zur Ausstattung gehören eine Gaszentral- Etagenheizung mit Wandradiatoren, Klimaanlage w/k und Marmorfußböden. Im Preis inbegriffen sind noch 2 Stellplätze und ein kleiner Abstellraum in der Tiefgarage. Ein Gemeinschafts Aussenpool mit Liegeterrassen runden das Angebot ab','33742','1050000','106','2015-11-19 11:25:18','106','2015-11-19 11:26:04',Null,'2517','105','1181',1,'1','0',Null,Null,Null,'33743',Null,'0','0','0',Null,'2015-11-19 11:31:44',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33744',Null,'33745',Null,'33746',Null,'33747',Null,'33748','0',0,'0');
